syntax = "proto2";

package com.account;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.account";
option java_multiple_files = true;
option java_outer_classname = "RoamingWebAckPushMsgProto";

message RoamingWebAckPushMsg {
  optional int64 userId = 1;
  optional string roamingFlowId = 2;
}